import React from 'react';

function HeroItem({ hero, onDelete, onEdit }) {
    return (
        <tr>
            <td>{hero.name}</td>
            <td>{hero.publisher}</td>
            <td>{hero.gender}</td>
            <td>{hero.height}</td>
            <td>{hero.weight}</td>
            <td>
                <button onClick={onEdit}>Editar</button>
                <button onClick={onDelete}>Eliminar</button>
            </td>
        </tr>
    );
}

export default HeroItem;
